import React, { Component } from 'react'; 
import './index.css';

export default class ForestDisplay extends Component {
    render() {
        return(
            <div>
                <section class="forest-page">
                        <div id="clock" class="clock centered" aria-label="current time">Current Time</div>
                        <div class="forest-image">
                            <img id="forest" src="./img/forest.jpg" alt="Your Forest"/>
                            <div id="trees">

                            </div>
                            <div id="flowers">

                            </div>
                        </div>
                        <br aria-hidden="true"/>
                        <button type="button" id="main-btn" aria-label="Take a break" role="button">Start</button>
                    </section>
            </div>
        )
    }
}
